// src/App.js (REPLACE the old content with this)
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';               // Import your Home page
import Conversation from './pages/Conversation'; // Import your Conversation page
// You might want a general CSS file for layout/theme shared across pages
// import './App.css'; // Example: Optional global styles

function App() {
  return (
    <Router>
      {/* You could add a common Header/Navbar here if needed */}
      <Routes>
        {/* Route for the Home page */}
        <Route path="/" element={<Home />} />

        {/* Route for the Conversation page */}
        <Route path="/conversation" element={<Conversation />} />

        {/* Add other routes here if you expand the app */}
      </Routes>
      {/* You could add a common Footer here if needed */}
    </Router>
  );
}

export default App;
